nums = [0,0,0]
res = []
ans=[]
nums.sort()
for i, a in enumerate(nums):
    if i > 0 and a == nums[i - 1]:
        continue
    l, r = i + 1, len(nums) - 1
    while l < r:
        threesum = a + nums[l] + nums[r]
        if threesum < 0:
            l += 1
        elif threesum > 0:
            r -= 1
        else:
            res.append([a, nums[l], nums[r]])
            l += 1
            while nums[l] == nums[l - 1]:
                l += 1


print(res)
